using System.Net;
using Figgle;

internal static class Extensions
{
    public static IPAddress?[] GetAddress(this string address)
    {
        string[] data = address.Split(',');
        IPAddress?[] result = new IPAddress[2];
        for (int i = 0; i < 2; i++) {
            string ip = data[i].Trim();
            IPAddress? iPAddress;
            IPAddress.TryParse(ip, out iPAddress);
            result[i] = iPAddress;
        }
        return result;
    }

    public static string ToCenter(this string text)
    {
        return string.Format("{0," + ((Console.WindowWidth / 2) + (text.Length / 2)) + "}", text);
    }

    public static string ToLogo(this string text)
    {
        byte[] dos_rebel = Convert.FromBase64String("");
        using (MemoryStream ms = new MemoryStream(dos_rebel))
        {
            var font = FiggleFontParser.Parse(ms);
            var logo = font.Render(text).Trim();
            var lines = logo.Split(new[] { Environment.NewLine }, StringSplitOptions.None);
            var longestLength = lines.Max(line => line.Length);
            var leadingSpaces = new string(' ', (Console.WindowWidth - longestLength) / 2);
            return string.Join(Environment.NewLine, lines.Select(line => leadingSpaces + line));
        }
    }
}
